import{WebComponentService}from"./WebComponentService.min.js";function enterToClick(e){if("Enter"!==e.key)return;const t=e.target.getAttribute("data-enter-key-click-selector");if(!t)return;const n=document.querySelector(t);n&&(e.preventDefault(),n.click())}window.customElements.define("keydown-action-service",class extends WebComponentService{load(e){const t=e.querySelectorAll("[data-enter-key-click-selector]");for(const e of t)e.addEventListener("keydown",enterToClick)}});